import React from "react";
import Slider from "react-slick";

export default function Carousel() {
  var settings = {
    dots: true,
    infinite: true,
    speed: 500,
    slidesToShow: 1,
    slidesToScroll: 1
  };
  return (
    <Slider {...settings}>
        <div>
            <img src="https://www.perma-horti.com/wp-content/uploads/2019/02/image-2.jpg" alt="" />
          </div>
          <div>
            <img src="https://www.perma-horti.com/wp-content/uploads/2019/02/image-2.jpg" alt="" />
          </div>
          <div>
            <img src="https://www.perma-horti.com/wp-content/uploads/2019/02/image-2.jpg" alt="" />
        </div>
    </Slider>
  );
}
